import { BrowserRouter, Link, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import LoginPage from "./pages/LoginPage";

function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <Route exact path="/admin">
        Admin
      </Route>
      <Link to="/userPage">User</Link>
      <LoginPage />
    </BrowserRouter>
  );
}

export default App;
